import styled from "styled-components";

export const PageArea = styled.div`
  display: flex;
  margin-top: 20px;

  .leftSide {
    flex: 250px;
    margin-right: 10px;

    .filterName {
      fontsize: 15px;
      margint: 10px 0;
    }
  }
  .rightSide {
    flex: 1;
  }
`;
